import Navbar from './Nav';
import products from './data'
import Card from './Card';
function Home() {
  // const renderList = products.map((item, index) => 
  //                              <div key={index}>{item}</div>
  //                            );
  console.log(products);
  return (
    <div className="App">
      {products.map(person => {
    return (
      <Card key={person.id} props={person.title}>
        
      </Card>
    )
  })}
    </div>
  );
}

export default Home;
